    true,nt"url": null,nt"notes": "<p>HCUPnet is an on-line query system that
    provides free, instant access to the largest set of all-payer health care databases
    that are publicly available. Using HCUPnet's easy step-by-step query system, you
    can generate tables and graphs on statistics and trends for acute care hospitals
    in the U.S.</p>n<p>HCUPnet provides:<br />nuf0a7   National and regional estimates
    for inpatient stays and emergency department visits;<br />nuf0a7   State counts
    of inpatient stays and emergency department visits for those states that agreed
    to participate;<br />nuf0a7   National estimates on readmissions and readmission
    rates;<br />nuf0a7   National and regional information on quality of care in hospitals
    and potentially preventable admissions, based on the AHRQ Quality Indicators (QIs);</p>n<p>For
    most queries, detailed information is available for conditions and procedures (by
    ICD-9-CM codes and Clinical Classification Software), and for diagnosis related
    groups (DRGs).</p>n<p>HCUPnet allows easy access to information from datasets that
    are part of the Healthcare Cost and Utilization Project (HCUP); details on obtaining
    these datasets are also available in <a href="http://www.healthdata.gov">www.healthdata.gov</a></p>n",nt"license_title":
